
--
select QRT || ',' || rownum || ');'
from (select 'insert into municipios (id_pais, id_estado, municipio, estatus, fecha, id_user, id_municipio) values ('|| FIIDPAIS || ','|| FIIDESTADO || ',*' || FCMUNICIPIO || '*,1, SYSDATE(), 1' AS QRT  from tcgf_mpios
where fiidpais = 1 and fiidmunicipio < 570
order by fiidestado, fiidmunicipio asc)
order by rownum;

